import React from "react";
import Menu from "./Menu";
import { BrowserRouter } from "react-router-dom";

class Header extends React.Component {
  render() {
    return (
      <>
        <header className="header">
          <nav className="nav_menu">
            <BrowserRouter>
              <Menu />
            </BrowserRouter>
          </nav>
        </header>
      </>
    );
  }
}

export default Header;
